import './index.css';

function App() {
	return (
		<Navbar>
			<navItem icon="" />
			<navItem />
			<navItem />
		</Navbar>
	);
}

function Navbar(props) {
	return (
		<nav className="navbar">
			<ul className="navbar-nav">{props.children}</ul>
		</nav>
	);
}

function navItem(props) {
	return (
		<li className="nav-item">
			<a
				href="#"
				className="icon-button">
				{props.icon}
			</a>
		</li>
	);
}

export default App;
